import React, { Component } from 'react';
import { Link } from 'react-router-dom'
import { connect } from 'react-redux'
import { deleteHTTPHistory } from '../store/actions/httpHistoryActions'
import moment from 'moment';


class HistorySummary extends Component {
    state = {}
    handleClick = (e) => {
        console.log('id=', this.props.historyData.id)
        this.props.deleteHTTPHistory(this.props.historyData);

    }
    render() {
        console.log('this is summary', (this.props.historyData.createdAt.toDate()))
        return (<React-fragment>
            {this.props.historyData.userId === this.props.auth.uid && <div style={{ overflow: 'auto' }}>
                <Link to={'/'}>
                    <span style={{ color: 'green' }}>{this.props.historyData.method} </span>
                </Link>
                <span>{this.props.historyData.url}</span>
                <button style={{ color: 'red' }} onClick={() => this.handleClick(this)} >X</button>
                <p>{moment(this.props.historyData.createdAt.toDate()).fromNow()}</p>
            </div>}

        </React-fragment>);
    }
}


const mapDispatchToProps = (dispatch) => {
    return {
        deleteHTTPHistory: (history) => dispatch(deleteHTTPHistory(history))
    };
};


export default connect(null, mapDispatchToProps)(HistorySummary)
